function multiply(mat1, mat2)
{
///console.log(mat1, mat2)
    var res = []

    for (var i = 0; i < mat1.length; i++) {
    	res.push([])
        for (var j = 0; j < mat1[i].length; j++) {
            res[i].push(0);
    }}

    for (var i = 0; i < mat1.length; i++) {
        for (var j = 0; j < mat1[i].length; j++) {
            for (var k = 0; k < mat2[i].length-1; k++)
            	//console.log(i,j,k,mat2[i].length)
                res[i][j] = res[i][j] + (mat1[i][k] * mat2[k][j]) ; 
        }
    }
    return res
}

			function JAN_Glue(_dti_ar) {


				///console.log("GGG",_dti_ar,"%%%[5296,1286,5822]%%%%")


				var curr_big_line = _dti_ar[0]
				var curr_add_line = _dti_ar[1]

				for (var cutnum = 0; cutnum < _dti_ar.length - 1; cutnum++) {

					///curr_big_line = _dti_ar[0]
					curr_add_line = _dti_ar[cutnum * 1 + 1]

					var big_line_min_ind = 0
					var big_line_max_ind = 0
					var add_line_min_ind = 0
					var add_line_max_ind = 0
					var maxdist = -999999999999
					var mindist = 999999999999

					for (var i = 0; i < curr_big_line.length; i++) {
						for (var j = 0; j < curr_add_line.length; j++) {
							var dist_ij = (curr_big_line[i][0] - curr_add_line[j][0]) * (curr_big_line[i][0] - curr_add_line[j][0]) + (curr_big_line[i][1] - curr_add_line[j][1]) * (curr_big_line[i][1] - curr_add_line[j][1]) + (curr_big_line[i][2] - curr_add_line[j][2]) * (curr_big_line[i][2] - curr_add_line[j][2])
							///console.log(dist_ij)	
							if (mindist > dist_ij) {
								mindist = dist_ij
								big_line_min_ind = i
								add_line_min_ind = j
							}
							if (maxdist < dist_ij) {
								maxdist = dist_ij
								big_line_max_ind = i
								add_line_max_ind = j
							}
						}
					}

					//console.log("GGG2", big_line_min_ind , big_line_max_ind , add_line_min_ind , add_line_max_ind )

					var new_curr_big_line = []
					if (big_line_max_ind < big_line_min_ind) {
						for (var i = 0; i < big_line_min_ind + 1; i++) {

							new_curr_big_line.push(curr_big_line[i])
						}
					} else {
						for (var i = curr_big_line.length - 1; i > big_line_min_ind; i = i - 1) {

							new_curr_big_line.push(curr_big_line[i])
						}
					}


					if (add_line_max_ind > add_line_min_ind) {
						for (var i = add_line_min_ind; i < curr_add_line.length; i++) {
							new_curr_big_line.push(curr_add_line[i])

						}
					} else {

						for (var i = add_line_min_ind; i > -1; i = i - 1) {

							new_curr_big_line.push(curr_add_line[i])
						}
					}

					curr_big_line = new_curr_big_line
				}

				var ret = new_curr_big_line
				/*for (var i = 0; i < _dti.xyz_dti.length/3 - 1; i++) {
				ret.xyz_dti.push(_dti.xyz_dti[i*3])
				ret.xyz_dti.push(MidpointY-_dti.xyz_dti[i*3+1])
				ret.xyz_dti.push(_dti.xyz_dti[i*3+2])
				}
				//console.log(ret)*/
				Prev_JAN = ret
				return ret
			}

			function MakeHexSymbol(_dec) {
				if (_dec == 10) { return "a" }
				if (_dec == 11) { return "b" }
				if (_dec == 12) { return "c" }
				if (_dec == 13) { return "d" }
				if (_dec == 14) { return "e" }
				if (_dec == 15) { return "f" }
				return _dec
			}
			function MakeHex(_dec) {
				var FirstVal = String(MakeHexSymbol(Math.floor(_dec * 255 / 16)))
				var SecondVal = String(MakeHexSymbol(Math.floor(_dec * 255 - Math.floor(_dec * 255 / 16) * 16)))
				return FirstVal + SecondVal
			}
			function MakeFFRGB(_rgb) {
				///console.log(_rgb)
				if (_rgb) { return "#" + MakeHex(_rgb.r) + MakeHex(_rgb.g) + MakeHex(_rgb.b); }
				else { return "#000000" }
			}

			function GetLayerArea(_CurrSomaLayer) {
				var CurrLengthAtLayer = 0
				for (var eachcluster in _CurrSomaLayer) {
					for (var eachline in _CurrSomaLayer[eachcluster]) {
						for (var i = 0; i < _CurrSomaLayer[eachcluster][eachline].xyz.length - 1; i++) {
							var currxyz1 = _CurrSomaLayer[eachcluster][eachline].xyz[i]
							var currxyz2 = _CurrSomaLayer[eachcluster][eachline].xyz[i + 1]
							var CurrCutDist = GetDistXYZ(currxyz1, currxyz2)
							CurrLengthAtLayer = CurrLengthAtLayer + CurrCutDist
						}
					}
				}
				///console.log("fff", CurrLengthAtLayer,_CurrSomaLayer)
				return CurrLengthAtLayer
			}














			function GetDistXYZ(currxyz1, currxyz2) {
				return Math.sqrt(((currxyz1[0] - currxyz2[0]) * (currxyz1[0] - currxyz2[0])) + ((currxyz1[1] - currxyz2[1]) * (currxyz1[1] - currxyz2[1])) + ((currxyz1[2] - currxyz2[2]) * (currxyz1[2] - currxyz2[2])));
			}




			function GetLayerPointAtLength(_CurrSomaLayer, _LengthAtLayer) {
				///console.log("DDD8", _CurrSomaLayer, _LengthAtLayer)
				var CurrLengthAtLayer = 0
				var ret = [_LengthAtLayer, _LengthAtLayer, _LengthAtLayer]
				for (var eachcluster in _CurrSomaLayer) {
					for (var eachline in _CurrSomaLayer[eachcluster]) {
						for (var i = 0; i < _CurrSomaLayer[eachcluster][eachline].xyz.length - 1; i++) {
							///console.log("DDD7", CurrLengthAtLayer)
							var currxyz1 = _CurrSomaLayer[eachcluster][eachline].xyz[i]
							var currxyz2 = _CurrSomaLayer[eachcluster][eachline].xyz[i + 1]
							var CurrCutDist = GetDistXYZ(currxyz1, currxyz2)




							if (CurrLengthAtLayer + CurrCutDist > _LengthAtLayer) {
								var _currproportion = (_LengthAtLayer - CurrLengthAtLayer) / CurrCutDist
								ret = [currxyz1[0] + (_currproportion * (currxyz2[0] - currxyz1[0])), currxyz1[1] + (_currproportion * (currxyz2[1] - currxyz1[1])), currxyz1[2] + (_currproportion * (currxyz2[2] - currxyz1[2]))];
								return ret; /// currxyz1 ; 
							}
							CurrLengthAtLayer = CurrLengthAtLayer + CurrCutDist
						}
					}
				}
				return ret
			}

function clearThree(obj){
  while(obj.children.length > 0){ 
    clearThree(obj.children[0]);
    obj.remove(obj.children[0]);
  }
  if(obj.geometry) obj.geometry.dispose();

  if(obj.material){ 
    //in case of map, bumpMap, normalMap, envMap ...
    Object.keys(obj.material).forEach(prop => {
      if(!obj.material[prop])
        return;
      if(obj.material[prop] !== null && typeof obj.material[prop].dispose === 'function')                                  
        obj.material[prop].dispose();                                                      
    })
    obj.material.dispose();
  }
}
